export default function Footer() {
  return (
    <div >
  <footer class="bg-light text-center text-lg-start" style={{backgroundColor: "rgb(0,0,0)"}}>

  <div class="text-center p-3" style={{backgroundColor: "rgb(63,83,115)"}}>
    Creacion de camila, luis y silvana
  </div>

</footer>
  
</div>
  )
}
